('13688','3','48','127','oOhiYjmz8h5pMX2jccpTJ3Io0BLs','news','a:4:{s:7:\"content\";s:771:\"1.猪瘟疫苗打三次（21天-60天-140斤）\n2.伪狂犬疫苗打三次（3天，30天，70天）\n3.口蹄疫苗打三次（断奶，45天，120天）\n4.驱虫药用三次（断奶后，90天，120天），有兴趣的可以试用一下\n猪瘟第一次建议用高价苗，抗体来的快，二次用兔化弱毒苗(50头分几块钱个)保护时间长，三次还是兔化苗，剂量2～8～10头分，三次驱虫，从断奶喂粉料开始第一次，驱虫药选复方的最好(伊维菌素+阿苯达咗，或芬苯达咗)，一次用七天，育肥阶段的两次驱虫，能有效提高饲料吸收，减少饲料浪费。\n 口蹄疫苗三次最好不要都打成单O型的特别是不要三次都用合成肽的，建议O A型，O 亚洲1型，单O各打一次\";s:8:\"original\";N;s:11:\"redirection\";b:0;s:6:\"source\";N;}','text','1453876380'),
